import React, {useState, useEffect} from 'react';
import searchImg from './Images/searchImage.png';
import axios from "axios";
import './Search.css';


function returnSearch() {
    axios
        .post("/search", {
            search: document.getElementById('searchpart').value,
        })
        .then((res) => {
            console.log(res.data);
        })
}

function Search() {

    return (
        <div className = "search">
            <div className = "row">
                <div className = "Search-Middle">
                    <button id="searchButton">

                    </button>
                </div>
                <div className = "Search-Middle">
                    <form className='searchBar' onSubmit={returnSearch}>
                        <input id='searchpart' className='searchInput' type='text' placeholder='Search here...'/>
                    </form>
                </div>
                <br />
                <div className = "Search-Middle">
                    <p></p>
                </div>
                <div className = "Search-Middle">
                    <p></p>
                </div>
            </div>
        </div>
  );
}

export default Search;
